import "./Todolist.css"
import React from "react"

function Todolist(props) {
    const todoList = props.todoList.map((task, index) => {
        return <li key={index}>
            <div>
{task.todo}
            </div>
            <div>

            </div>
        </li>
    });
    return (
        <div className="taskList">
            <ul>{ todoList}</ul>
        </div>
    )
}
  

export default Todolist
